import React from 'react'
import Link from 'rea'
export default function Home(){
    return (
        <div id='home'>
            <Link to="/ame">Game</Link>
            <Link to='/options'>Options</Link>
            <Link to="/credits">Credits</Link>
        </div>
    )
}
